import React from "react";
import { Box } from "@mui/system";
import "./SidebarData.css"
import { useNavigate } from "react-router-dom";
import "../App.css"
import { useState } from "react";

const SidebarData = () => {
    const[iconOne, setIconOne]= useState(false)
    const[iconTwo, setIconTwo]= useState(false)
    const[iconThree, setIconThree]= useState(false)
    const[iconFour, setIconFour]= useState(false)
    const[iconFive, setIconFive]= useState(false)

    let navigate = useNavigate();




    return (
        <div className="data">
            <ul className="side-list">
                <li>
                    <img
                        style={{backgroundColor: iconOne ? 'blue' : ''}} 
                        onClick={() => {
                            setIconOne(true)
                            navigate("/")
                        }}
                        src="orders.svg"
                    />
                </li>
                <li>
                    <img
                        style={{backgroundColor: iconTwo ? 'blue' : ''}} 
                        onClick={()=> {
                            setIconTwo(true)
                            navigate("/customers")
                        }} 
                        src="customer.svg"
                    />
                </li>
                <li>
                    <img 
                        src="Package.svg"
                    />
                </li>
                <li>
                    <img 
                        src="Coupon Discount.svg"
                    />
                </li>
                <li>
                    <img 
                        src="user.svg"
                    />
                </li>
            </ul>
            <ul className="side-list">
                <li>
                    <img 
                        src="settings.svg"
                    />
                </li>
            </ul>
        </div>
    )
}

export default SidebarData
